/* eslint no-unused-vars: 0 */
import ifDefined from '@ui5/webcomponents-base/dist/renderer/ifDefined.js';
import { html, svg, repeat, classMap, styleMap } from '@ui5/webcomponents-base/dist/renderer/LitRenderer.js';
const block0 = (context) => { return html`<div	class="${classMap(context.classes.wrapper)}"><span id="${ifDefined(context._id)}-hiddenText" class="ui5-hidden-text">${ifDefined(context.tokenizerLabel)}</span><div		class="${classMap(context.classes.content)}"		@ui5-delete="${ifDefined(context._tokenDelete)}"		role="listbox"		aria-labelledby="${ifDefined(context._id)}-hiddenText"	>		${ repeat(context.tokens, (item, index) => item._id || index, (item, index) => block1(item, index, context)) }</div>	${ context.showNMore ? block2(context) : undefined }</div>`; };
const block1 = (item, index, context) => { return html`<slot name="${ifDefined(item._individualSlot)}"></slot>		`; };
const block2 = (context) => { return html`<span			@click="${context._openOverflowPopover}"			class="ui5-tokenizer-more-text"		>${ifDefined(context._nMoreText)}</span>	`; };

export default block0;
